Jun Xie was the number one assassin in modern earth. His skills and knowledge in the field of assassination were unparalleled, his accomplishments unprecedented, his reputation terrified the entire underworld. However, during a mission to retrieve a mystical treasure, a mishap occurred&hellip;

He is now Jun Moxie, a sixteen year old super level debauchee, sole heir to the declining Jun family. A family of valiant heroes, left with an old grandpa, a crippled uncle and a debauchee as the sole heir! Accepting the world&rsquo;s criticism and cold stares with a smile, his new journey begins! His life will be carved by his own will! Rise to the top! Evil Monarch Jun Xie!

&ldquo;This cup I toast to those I&rsquo;ve killed in my past life. Forgive me, for there is no chance for you to have revenge. Gulp!&rdquo;

&ldquo;This cup I toast to those whose life I will take in my new life. Forgive me, for you are fated to die by my hands. Cheers!&rdquo;

Yoo Se-rin, an actress has long had a crush on Sung Lee-Hyun, the head of the agency that found her.

She couldn&rsquo;t hide her  feelings for him anymore, asking him to teach him about sex on the pretext of filming&hellip;

&ldquo;Then take it off. Don&rsquo;t leave out a single thing.

If I step back now, I&rsquo;ll never have a chance.

I want him to see me as a woman&hellip;

Shin Jae-Won attended the World Camp hosted by the Spanish King as a tennis player in his Junior Year.

Jae-Won meets Javier, an unusually conspicuous participant in the World Camp.

&ldquo;When are we going to practice?&rdquo;

There are always people (especially women) around him.

Then, Jae-Won, who happened to stumble upon Javier one night during practice, ended up spending the night alone. The more he faced his whimsical, pure side, the more his heart began to beat&hellip;

&ldquo;I hate this kind of things&hellip;&rdquo;

Jae-Won&rsquo;s first love ended as fast as a Siesta.

A decade later, they meet again Spain.

