Taken in as a child, Toshiyuki grew up with Yama like a brother and ended up becoming Yama's caretaker.

Lacking satisfaction and stimulation one day, Yama ordered Toshiyuki to take care of his dick...

After signing a contract to get her romance webtoon serialized, college student Son Woori comes home to get dumped by her girlfriend. A homophobic (or not?) neighbor witnesses the whole ordeal. With the added pressure of deadlines for her webtoon, she has little time to deal with her heartbreak. It doesn't make it easier that this neighbor, who claims she doesn't want to get involved, keeps running into her!
from Tapas:
Hell yeah! A major publisher wants Mai Sohn to write a webcomic on relationships. But she&rsquo;s struck with heartbreak as her girlfriend abruptly dumps her. It&rsquo;s hard writing about relationships without being in one, so she needs to find the inspiration for love &mdash; and find it fast. And what&rsquo;s up with her possibly homophobic neighbor? Why is she cool with Mai one minute and then so awkward and weird to her the next?! Can&rsquo;t a girl catch a break?

A 21st century female forensic doctor somehow travels and wakes up in ancient China!
 She cross-dresses to survive but becomes a princess after a special patient treatment.
&quot;You know Chinese medicine? One treatment can earn you two-hundred-two yuan.&quot;
&quot;No, change tactics, the king will give you four hundred and two yuan.&quot;

Yunifer Magnolia was the best friend of the novel's heroine, Rael Cania, until her love for the male lead turned her into a villainess. Her harassment of Rael, Ishid's lover, condemned her to death at the hands of Cassian, the Crown Prince.

&quot;So I reincarnated as... Yunifer?!&quot;

This Yunifer wants to live, though! To stay safe, she decides to avoid all the main characters of the novel. But one drunken encounter with Ishid ruins all her plans...

&quot;I don't do one-night stands.&quot;
&quot;Then let's say we just started dating!&quot;

Will Yunifer be able to correct her own twisted fate? Or will she face death once more, as foretold by the novel?

Hang Ah was an incarnation of the moon.
She was the guardian of the palace since its founding, and her protection resulted in a thousand years of prosperity. But, after a thousand years, she disappeared. All kinds of disasters happened as if it was waiting for this moment of vulnerability. At the same time, a child considered as &lsquo;The Second Hang Ah&rsquo; appeared. She wanted to go away believing all of this was a lie.

&ldquo;The Hang Ah I know had beautiful hair resembling the moonlight... Just like you.&rdquo;
&lsquo;I&rsquo;m&hellip; Hang Ah? I can&rsquo;t believe it&hellip;&rsquo;

&quot; You have been selected as the fittest&quot;
&quot; With your abilities, the survival rate in Selha Latna is less that [5%]. &quot;
&quot;Do you want to commit suicide? Y/N&quot;
&quot;X-&quot;
Less than a 5% chance of survival.  22 years. Countless battles with the demon dogs.  In this hell; I'm surviving alone.
Hidden behind level 5, together with the outrageous hidden stats! 
The extreme survival record of the strongest level 5 swordsman Ryu han bin who was thrown into this other world with just a sword.

When I opened my eyes, I was inside a fantasy novel world! The beauty I see in front of the mirror is the future tyrant's older sister, Alicia! She's not even a protagonist or an antagonist, but a character that doesn't appear much and gets beheaded by her (future) tyrant little brother. My life is all about escaping that fate from the novel. In the end, I seduced the male lead's merchant friend who also doesn't appear much and was about to leave the country with him. How-e-ver&ndash; The face of the man who spent the night with me was extraordinary.

&quot;I-I'm pretty sure the name I heard yesterday wasn't that name but something else. Uhm, what was it. I-I think it's Sir Lancelot.&quot;

&quot;Ah, that's my friend.&quot;

&quot;&hellip;&quot;

&quot;Why, is there a problem?&quot;

Excuse me, you're asking if there's a problem? A lot. There are a lot of problems with that.

...Why is the male lead on my bed?![hr]Based on the Original Webnovel by Aperta

On the day of the Wizarding City Paz's destruction, Amina got stuck inside a lamp while trying to turn back time. And 300 years later, she was awakened by a military commander, Jakal.

&ldquo;I do not have any wishes for you to grant&rdquo;
Well, I just want to hurry and grant a wish so I can go back, who the hell is this guy?

&ldquo;Do you know who I am?&rdquo;
&ldquo;There is no one else in this world who knows you better than I do.&rdquo;
&ldquo;That&rsquo;s not possible..... I&rsquo;ll disappear one of these days!&rdquo;

Amina, who needs to go back into the lamp after granted the wishes suddenly meets Jakal who wants to give up his wishes to be with her. However, there are many dangers and threats that prevent him from doing so. Will Amina achieve her wish in the end?

&quot;Это я скрывал свои чувства. Прости.&quot;
Сакураи Хиёри работает на фирме, производящей сладости, и хочет придумать такое же вкусное лакомство, как её любимый шоколад &quot;Park&quot;. Но оказывается, что этот шоколад изобрёл её суровый демон-босс по имени Суго! Каждый день терпя унижения и оскорбления, Хиёри тайно мечтает о Суго. Однако, поговаривают, что Суго встречается с самоуверенной, но доброй девушкой-красавицей... Тайная любовь Хиёри оказалась вовсе не слаще конфет!
Офисная комедия положений о начальнике-садисте и подчинённой-оптимистке!

Shiro and Sougo have been friends since childhood. One day, Shiro confessed his feelings and asked Sougo to marry him, &ldquo;I like you, please marry me when we&rsquo;re adults!&rdquo;

&ldquo;Don&rsquo;t you know the law says two men can&rsquo;t get married?&rdquo;

Many years later&hellip;

&ldquo;For you, I changed the law, so, please, marry me!&rdquo;

This voice, this song, this echo.
Through this sound, this is the melody of two people coming together both heart and body.

Guitarist Kouhei is always fighting with his other band members due to wanting to go a different direction. Then while he&rsquo;s at a local music venue, he hears an incredible singing voice and falls in love at first &ldquo;sound.&rdquo; He doesn&rsquo;t know who the voice belongs to or where it came from, but when X mysteriously appears, Kouhei unconsciously gets hard. He searches desperately to find him again, but his only clues were X&rsquo;s voice and a tattoo on his left arm. After several months with no luck, he runs into X by chance at the convenience store! Kouhei starts hitting on the man who introduces himself as &ldquo;Rei,&rdquo; only to be completely rejected&hellip;

Cells have been working in the baby's body since it was in the mom's belly. 
&quot;Where should I carry oxygen?!&rdquo;
 &ldquo;The germs are coming! I have to run away!!&rdquo; 
Like everyone's first job in their life, I&rsquo;m learning a lot on the go. Still, I'm working hard to protect my body!! We&rsquo;re doing their best to turn over the baby! This is an anthropomorphic cartoon inside the baby dedicated to busy moms and dads, and everyone who used to be a BABY!

I was studying for a test, slowly succumbing to the lull of sleep, when my eyes fluttered shut...  And the next thing I knew, I had tripped into another world&mdash;&mdash;

I found myself in a remote village in the countryside, Thrall Village. From being taken in by the village chief as his adopted daughter, to learning about the country and its language, my leisurely life there had begun. In this manner, six years quietly flew by. 

But one day, I was suddenly summoned to the royal capital to become a priest&rsquo;s secretary!? Moreover, I received an important task &mdash; to find a bride for the Archbishop!

&quot;Loving You, Isn't Enough.&quot;

Ruka (omega) and Taisei (alpha) are mates. They don't live together, and only meet when Ruka has his heat. When the sex is over, Taisei would hurry up and go home, and Ruka always couldn't say the words &quot;Don't go!&quot;

A painful love story of two that can't be honest with their feelings and their relationship and feelings are all twisted.

&quot;The sun is strong, consistent, but dangerous. The moon is exquisite, though extremely cold.&quot;

For a long time just being childhood friends, Shi Yun and Tao Bin are slowly aware of each other's feelings. These two people who are full of secrets little by little starts to open their hearts. But, among them, there is also another person, the 'swimming buddy' Fan Yang.

Both are as strong as the sun, as cold and exquisite as the moon. Shi Yun hesitated. Who will he choose?

The metropolis of Hasgar is crossed by an imposing wall. On the west side, there is a huge ghetto, where terrorism and misery wreak havoc. On the East side, in the city center are standing up high ultramodern towers, where the rich and the leaders live.

In the chaos of the poor neighborhood, a new hero appears. Armed with a metal bar, his face hidden under a gas mask, his ears covered with a helmet spitting music, he comes out of nowhere when despair is at its height and crushes his enemies in an unleashead violence. He's called&hellip; Guess What!

The governor, who cannot leave such a disturbing element in the city, calls on Nika, an elite soldier, to investigate. But as seasoned as she is, the young woman is far from imagining the terrifying secrets buried in the shallows of Hasgar&hellip;

Priscilla Motia works as a sorceress at the mercenary corps, but she was once the only daughter of a count. Until her father died, and her stepmother made a fortune from selling their valuables to her divorced husband who was 10 years older...

In an accident while working as a mercenary, Priscilla got her hands on the Dragon Heart just before she dies... This is a chance to take back the 15 years that she lost! She is determined to go on a big adventure. 

&ldquo;You're back!&quot; 

But what awaited Priscilla was a huge debt caused by her evil divorced husband.

Seeking for revenge, Priscilla goes looking for Kian Rustin, the Black Death of the Battlefield for help and asks, &ldquo;I have a favor to ask of you.&quot;

&ldquo;What do you want me to do? Is this an assassination attempt?&quot; 

&quot;Kian Rustin! Please be my husband.&quot; 

So, will Priscilla be able to win both land and love?
